    <h2>Body Image</h2>
    <div style={{ display: 'flex', overflowX: 'auto' }}>
      {/* Scrollable container for text box */}
      <Paper style={{ display: 'flex', flexDirection: 'column', width: '200px', padding: '10px', marginRight: '10px', backgroundColor: 'pink' }}>
